import React from 'react';

const RegistrationGuide = () => {
  return (
    <div className="registration-guide">
      <h1>How to Register as a Seller</h1>
      <p>Follow these steps to register as a seller on KiranaBazaar:</p>
      <ol>
        <li>Step 1: Create an account on KiranaBazaar.</li>
        <li>Step 2: Fill in your business details.</li>
        <li>Step 3: Upload necessary documents.</li>
        <li>Step 4: Start listing your products.</li>
      </ol>
    </div>
  );
};

export default RegistrationGuide;
